  render() {
    const {product} = this.props;
    return (
      <tr className="product-row">
        <td><img src={product.photo} alt="" className="product-row-photo"/></td>
        <td className="product-row-data">{product.product}</td>
        <td className="product-row-data">{product.size}</td>
        <td className="product-row-data">{product.quantity}</td>
        <td className="product-row-data">{product.price}</td>
      </tr>
    );
  }
}

export default ProductRow;
